import React from 'react';

function List(prp) {
  return (
    <>
      <div className="first">
        <div className="innerName">
          <img src={prp.imgsrc} />
          <h1 className="h1">{prp.title}</h1>
          <p className="sName">{prp.sNmae}</p>
          <a className="link">{prp.link}</a>
        </div>
      </div>
    </>
  );
}

export default List;
